    //     for (uint i = index; i<sellOrders.length;i++){
    //         sellOrders[i] = sellOrders[i+1];
    //     }
        
    //     sellOrders.pop();

    // }

    function min(uint a, uint b) internal pure returns (uint){
        return a < b ? a : b;
    }
}

